package day6_operators_boolean;

public class SwapVariableValues {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int num1 = 100;
		
		int num2 = 200; 
		
		num1 = num1+num2;
		
		num2 = num1 - num2;
		
		num1 = num1 - num2;
		
		System.out.println(num1 + " " + num2);
	
		
		
		
		
	}

}
